import React from 'react';

// IMAGES
// import Home from '../../Images/connectourkidshome.jpg';
import CardsVsAIScreenshot from '../../Images/CardsVsAIScreenshot.jpg';
import sample from '../../Images/CVSAI'
import '../../css/CardsVsAI.css'


export default class CardsVsAI extends React.Component {

    toGitHub = () => {

        window.location = 'https://github.com/MaxGunter99/CardsVsAI'

    }

    render() {

        return (

            <div className='CardsVsAIDiv'>

                <h1>Cards Vs AI</h1>

                <div className='CardsVsAIContent'>

                    <div className='CardsVsAIImages'>
                        <img src={ CardsVsAIScreenshot } className='CardsVsAIScreenshot' alt='CardsVsAIScreenshot' />
                        {/* <img src={ 'https://ephmedia.giphy.com/aa683c82-14e0-4f1c-abec-217361c84051.gif' } className='CardsVsAIScreenshot' alt='CardsVsAIScreenshot' /> */}

                        <video className='videoTag' autoPlay loop muted>
                            <source src={sample} type='video/mp4' />
                        </video>
                    </div>

                    <div className='Info'>

                        <p class="Card">Empowering child welfare professionals with a tool that easily searches extended family members that may be able to care for the child in place of putting them into the foster care system, connecting to family members immediately.</p>

                        <ul>
                            <li>Built in React Native</li>
                            <li>4 week project</li>
                            <li>5 developers on our team</li>
                            <li>Participated in daily standups</li>
                            <li>Stayed in contact with stakeholder</li>
                        </ul>

                        <button className = 'GitHub' onClick = { () => this.toGitHub() }>View on GitHub</button>

                    </div>

                </div>

            </div>

        )

    }

}
